import React, {Component} from 'react'
import Stats from './Stats'
import ListeMessagesV2 from '../messages/ListeMessagesV2'

class BodyAccueil extends Component{
    constructor(props){
        super(props)
    }

    render(){
        var n = this.props.isNuit() ? "V2" : ""
        return (
        <div className={"corps"+n}>
            <Stats/>
            <ListeMessagesV2 changePage={this.props.changePage} nuit={this.props.nuit} isNuit={this.props.isNuit}/>
        </div>
        )
    }
}

export default BodyAccueil;
